ControlPropertyState.AutoRuleBindingString:
With(
    {dateToEvaluate: Today()},
    If(
        Year(dateToEvaluate) = Year,
        With(
            {
                date1: Date(
                    Year(dateToEvaluate - Weekday(dateToEvaluate - 1) + 4),
                    1,
                    3
                )
            },
            With(
                {
                    rup: RoundUp(
                        dateToEvaluate - date1,
                        0
                    ),
                    wd: Weekday(date1) + 5
                },
                RoundDown(
                    (rup + wd) / 7,
                    0
                ) + 1
            )
        ),
        1
    )
)

ForAll( Sequence(7,0), With( { week_date: DateAdd( ThisItem.weekStartDate, Value, Days ) },
{
    Day: Day(week_date),
    WeekDay: Switch(Weekday( week_date ), 1, "Sun", 2, "Mon", 3, "Tue", 4, "Wed", 5, "Thu", 6, "Fri", 7, "Sat") 
}) )
